import React from "react";
import "./sidebar.css";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import SidebarChannel from "./sidebarChannel";
import AddIcon from "@mui/icons-material/Add";
import SignalCellularAltIcon from "@mui/icons-material/SignalCellularAlt";
import InfoOutlinedIcon from '@mui/icons-material/InfoOutlined';
import CallIcon from '@mui/icons-material/Call';
const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar__top">
        <h3 className="text-xl">Clone Disc</h3>
        <ExpandMoreIcon />
      </div>
      <div className="sidebar__channels">
        <div className="sidebar__channelsHeader text-lg text-gray-400 p-4 justify-between items-center flex">
          <div className="flex space-x-4 flex-1 text-gray-500 items-center">
            <ExpandMoreIcon />
            <h2>Text-Channel</h2>
          </div>
          <AddIcon className="hover:text-white cursor-pointer" />
        </div>
        <div className="sidebar__channel">
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
          <SidebarChannel />
        </div>
      </div>
      <div className="text-[#4fb185] bg-[#2f3135] border-t p-2 border-gray-500 flex items-center justify-center">
        <SignalCellularAltIcon fontSize="large" />
        <div className="text-gray-500 flex-1 p-2">
          <h3 className="text-[#4fb185]" >Voice Connected</h3>
          <p className="text-xs">stream</p>
        </div>
        <div className="flex-col">
          <InfoOutlinedIcon/>
          <CallIcon/>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
